import PropertyList from "../component/properties/PropertyList";
import { useState } from "react";


function AllPropertiesPage() {
  const [isLoading, setIsLoading] = useState(true);
  const [loadedProp, setLoadedProp] = useState([]);
  fetch("http://localhost:3002/properties")
    .then((response) => {
      return response.json();
    })
    .then((data) => {
      setIsLoading(false)
      setLoadedProp(data)
      console.log(loadedProp)
    });

  if(isLoading){
    return (
      <section>
        <p>
          loading...
        </p>
      </section>
    );
  }
  return (
    <section>
      <h1>all properties</h1>
      <PropertyList properties={loadedProp} />
    </section>
  );
}

export default AllPropertiesPage;
